      try {
        const response = await fetch('http://localhost:8080/usuarios/detalles');
        if (!response.ok) throw new Error('Algo salió mal al obtener los usuarios');
        const data = await response.json();
        setUsuarios(data);
      } catch (error) {
        setError(error.message);
      } finally {
        setCargando(false);
      }
    };

    const handleChange = (e) => {
      setUser({ ...user, [e.target.name]: e.target.value });
    };

    const handleSubmit = async (event) => {
      event.preventDefault();

      const formData = {
        ...usuarioForm,
        rol: parseInt(usuarioForm.rol, 10),
        pasaporte: parseInt(usuarioForm.pasaporte, 10)
      };


      console.log("Enviando datos al backend:", formData);

      try {
        const response = await fetch('http://localhost:8080/usuarios/crear', {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify(formData)
        });

        if (!response.ok) throw new Error('Error al crear el usuario');

        const nuevoUsuario = await response.json();
        console.log("Usuario creado con éxito:", nuevoUsuario);

        fetchUsuarios(); // Refrescar la lista de usuarios después de la creación
        setUsuarioForm({ // Resetear el formulario después de la creación exitosa
          email: '',
          password: '',
          primer_nombre: '',
          segundo_nombre: '',
          primer_apellido: '',
          segundo_apellido: '',
          fecha_nacimiento: '',
          nacionalidad: '',
          pasaporte: '',
          rol: '',
        });
      } catch (error) {
        console.error("Error al crear el usuario:", error);
        setError(error.message);
      }
    };

    return (
      <div>
        <h2>Administrar Usuarios</h2>
        <Form onSubmit={handleSubmit}>
          <Form.Group controlId="formEmail">
            <Form.Label>Email</Form.Label>
            <Form.Control type="email" placeholder="Email" name="email" value={usuarioForm.email} onChange={handleChange} required />
          </Form.Group>
          <Form.Group controlId="formPassword">
            <Form.Label>Contraseña</Form.Label>
            <Form.Control type="password" placeholder="Contraseña" name="password" value={usuarioForm.password} onChange={handleChange} required />
          </Form.Group>
          <Form.Group controlId="formBasicFirstName">
              <Form.Label>Primer Nombre</Form.Label>
              <Form.Control 
                type="text" 
                placeholder="Ingrese su primer nombre" 
                name="primer_nombre" // Cambiado a snake_case para coincidir con la clase Java
                value={user.primer_nombre} // Asegúrate de ajustar el estado inicial
                onChange={handleChange}
              />
            </Form.Group>

            <Form.Group controlId="formBasicSecondName">
              <Form.Label>Segundo Nombre</Form.Label>
              <Form.Control 
                type="text" 
                placeholder="Ingrese su segundo nombre" 
                name="segundo_nombre" // Cambiado a snake_case
                value={user.segundo_nombre} // Asegúrate de ajustar el estado inicial
                onChange={handleChange}
              />
            </Form.Group>

            <Form.Group controlId="formBasicLastName">
              <Form.Label>Primer Apellido</Form.Label>
              <Form.Control 
                type="text" 
                placeholder="Ingrese su primer apellido" 
                name="primer_apellido" // Cambiado a snake_case
                value={user.primer_apellido} // Asegúrate de ajustar el estado inicial
                onChange={handleChange}
              />
            </Form.Group>

            <Form.Group controlId="formBasicSecondLastName">
              <Form.Label>Segundo Apellido</Form.Label>
              <Form.Control 
                type="text" 
                placeholder="Ingrese su segundo apellido" 
                name="segundo_apellido" // Cambiado a snake_case
                value={user.segundo_apellido} // Asegúrate de ajustar el estado inicial
                onChange={handleChange}
              />
            </Form.Group>
          <Form.Group controlId="formFechaNacimiento">
            <Form.Label>Fecha de Nacimiento</Form.Label>
            <Form.Control type="date" name="fecha_nacimiento" value={usuarioForm.fecha_nacimiento} onChange={handleChange} required />
          </Form.Group>
          <Form.Group controlId="formNacionalidad">
            <Form.Label>País de Origen</Form.Label>
            <Form.Select name="nacionalidad" value={usuarioForm.nacionalidad} onChange={handleChange} required>
              <option>Seleccione un país</option>
              {countries.map((country) => (
                <option key={country} value={country}>{country}</option>
              ))}
            </Form.Select>
          </Form.Group>
          <Form.Group controlId="formPasaporte">
            <Form.Label>Número de Pasaporte</Form.Label>
            <Form.Control type="text" name="pasaporte" placeholder="Número de Pasaporte" value={usuarioForm.pasaporte} onChange={handleChange} required />
          </Form.Group>
          <Form.Group controlId="formRol">
            <Form.Label>Rol</Form.Label>
            <Form.Select name="rol" value={usuarioForm.rol} onChange={handleChange} required>
              <option>Seleccione un rol</option>
              {roles.map((rol) => (
                <option key={rol.id} value={rol.id}>{rol.name}</option>
              ))}
            </Form.Select>
          </Form.Group>
          <Button variant="primary" type="submit">Crear Usuario</Button>
        </Form>

        {cargando ? <p>Cargando...</p> : error ? <p>Error: {error}</p> : (
      <Table striped bordered hover>
      <thead>
        <tr>
          <th>ID</th>
          <th>Primer Nombre</th>
          <th>Primer Apellido</th>
          <th>Email</th>
          <th>Rol</th>
          <th>Acciones</th>
        </tr>
      </thead>
      <tbody>
        {usuarios.map(usuario => (
          <tr key={usuario.id}>
            <td>{usuario.id}</td>
            <td>{usuario.primerNombre}</td>
            <td>{usuario.primerApellido}</td>
            <td>{usuario.email}</td>
            <td>{usuario.rolNombre}</td>
            <td>
              <Button variant="secondary" size="sm">Editar</Button>
              <Button variant="danger" size="sm" className="ms-2">Eliminar</Button>
            </td>
          </tr>
        ))}
      </tbody>
    </Table>
    )}
  </div>
);
}

export default AdministrarUsuarios;
